import React, { Component } from 'react'
import styled from '@emotion/styled'
import Input from './components'
import { getGames } from './api'

const Container = styled.div`
  width: 100%;
`

class App extends Component {
  constructor(props) {
    super(props)
  }

  render() {
    return (
      <Container>
        <Input onSearch={() => this.getGames()} />
      </Container>
    )
  }
}

export default App
